PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE dim_product (
	product_id TEXT, 
	name TEXT, 
	category TEXT, 
	price FLOAT, 
	promotion_flag BIGINT
);
CREATE TABLE dim_store (
	store_id TEXT, 
	store_name TEXT, 
	city TEXT, 
	region TEXT
);
CREATE TABLE dim_customer (
	customer_id TEXT, 
	gender TEXT, 
	age_group TEXT, 
	income_level TEXT
);
CREATE TABLE dim_date (
	date_id DATETIME, 
	year INTEGER, 
	month INTEGER, 
	day INTEGER, 
	weekday INTEGER, 
	quarter INTEGER
);
CREATE TABLE fact_sales (
	transaction_id TEXT, 
	date_id DATE, 
	product_id TEXT, 
	customer_id TEXT, 
	store_id TEXT, 
	quantity BIGINT, 
	unit_price FLOAT, 
	promotion_applied BIGINT, 
	revenue FLOAT
);
COMMIT;
